import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { useSelector, useDispatch } from "react-redux";
import { logoutUser } from "../redux/actions/users/useractions";
import { useNavigate } from "react-router-dom";
import LogoutIcon from "@mui/icons-material/Logout";
import Tooltip from "@mui/material/Tooltip";
import GroupsIcon from '@mui/icons-material/Groups';
import PersonIcon from '@mui/icons-material/Person';
import SpellcheckIcon from '@mui/icons-material/Spellcheck';

function NavBar() {
    const dispatch = useDispatch();
    const userLogin = useSelector((state) => state.userLogin);
    const { userInfo } = userLogin;
    const history = useNavigate();
    const isstaff = sessionStorage.getItem("isstaff");
    const username = sessionStorage.getItem("userName");
    const logoutHandler = () => {
        dispatch(logoutUser());
        history("/");
    };
    const mystyle = {
        color: "white"
    }
    return (
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h4" component="div" sx={{ flexGrow: 1 }}>
                        Touchless Timesheet Tracker
                    </Typography>

                    {isstaff == true ?
                        <>
                            <a className="link" href="all-students" style={mystyle}
                            >
                                <Tooltip
                                    title="All-Students"
                                    style={{
                                        cursor: "pointer",
                                        marginRight: 100,
                                        fontSize: 45
                                    }}
                                    variant="contained"
                                >
                                    <GroupsIcon />
                                </Tooltip>
                            </a>

                            <a className="link" href="create-attendance" style={mystyle}
                            >
                                <Tooltip
                                    title="Generate-code"
                                    style={{
                                        cursor: "pointer",
                                        marginRight: 100,
                                        fontSize: 45
                                    }}
                                    variant="contained"
                                >
                                    <SpellcheckIcon />

                                </Tooltip>
                            </a>

                            <a className="link" href="user-profile" style={mystyle}
                            >
                                <Tooltip
                                    title="Your Profile"
                                    style={{
                                        cursor: "pointer",
                                        marginRight: 100,
                                        fontSize: 45
                                    }}
                                    variant="contained"
                                >
                                    <PersonIcon />
                                </Tooltip>
                            </a>

                            <button onClick={logoutHandler} className="logout">
                                <LogoutIcon />
                            </button>
                            <li className="items">
                                <Tooltip
                                    title={username}
                                    style={{ cursor: "pointer" }}
                                    variant="contained"
                                >
                                    <PersonIcon />
                                </Tooltip>
                            </li>
                        </>

                        :
                        <>
                            <a className="link" href="user-profile" style={mystyle}
                            >
                                <Tooltip
                                    title="Your Profile"
                                    style={{
                                        cursor: "pointer",
                                        marginRight: 100,
                                        fontSize: 45
                                    }}
                                    variant="contained"
                                >
                                    <PersonIcon />
                                </Tooltip>
                            </a>

                            <a className="link" href="get-student-detail" style={mystyle}
                            >
                                <Tooltip
                                    title="Know Your Data"
                                    style={{
                                        cursor: "pointer",
                                        marginRight: 100,
                                        fontSize: 45
                                    }}
                                    variant="contained"
                                >
                                    <PersonIcon />
                                </Tooltip>
                            </a>


                            <button onClick={logoutHandler} className="logout">
                                <LogoutIcon />
                            </button>
                        </>
                    }
                </Toolbar>
            </AppBar>
        </Box >
    );
}

export default NavBar
